  return (
    <header className="header">
        <img src={logo} className="logo" alt="logo" />
        <form className = "header-form">
          <input type="text" className = "header-form__search" placeholder ="Search"></input>
          <img src={searchlogo} className ="header-form__search-logo"></img>
          <button type="submit">UPLOAD</button>
        </form>




    </header>
  );
}

export default Header;
